import React from 'react'
import './Footer.css'
import ShuffleOutlinedIcon from '@mui/icons-material/ShuffleOutlined';
import SkipPreviousIcon from '@mui/icons-material/SkipPrevious';
import PlayCircleOutlineOutlinedIcon from '@mui/icons-material/PlayCircleOutlineOutlined';
import SkipNextIcon from '@mui/icons-material/SkipNext';
import LoopIcon from '@mui/icons-material/Loop';

function Footer() {
  return (
    <div className='footer'>
      <div className='footerLeft'> 1</div> 
      <div className='footerCenter'>
        <ShuffleOutlinedIcon className="footerGreen" />
        <SkipPreviousIcon className="footerIcon" />
        <PlayCircleOutlineOutlinedIcon fontSize="large" />
        <SkipNextIcon className="footerIcon" />
        <LoopIcon className="footerGreen" />
      </div> 
      <div className='footerRight'>3</div> 
    </div>
  )
}

export default Footer
